import React from "react";
import "./styles.css";

const OutputDocument = ({ output, downloadOutput, mergedPdfUrl }) => {
  return (
    <div className="output-container">
      <h3 className="output-text">Output</h3>
      {mergedPdfUrl && (
        <button href={mergedPdfUrl} download="merged.pdf">
          Download Merged PDF
        </button>
      )}
      <button
        className="download-button"
        onClick={() => downloadOutput("output.txt", output)}
      >
        Download
      </button>
    </div>
  );
};

export default OutputDocument;
